text:
**Date:** [Insert Date]  
**Time:** [Insert Time]  

**Patient Information:**  
- Status: Infant  
- Condition: Respiratory issues and potential sepsis  

**Respiratory Status:**  
- High-frequency oscillatory ventilation (HFOV) initiated;  
- Respiratory rate: 28-40 breaths per minute;  
- FiO2: Adjusted between 31-58%; initiated at 50% and increased during care;  
- Arterial blood gas (ABG) results:  
  - Initial: pH 7.13, pCO2 72  
  - Follow-up: pH 7.30, pCO2 47  
- Lung sounds: Coarse with crackles; secretions suctioned every 4-6 hours;  
- Periodic desaturations noted; lowest SaO2 at 80%;  
- Chest X-ray shows improved lung expansion and some haziness;  

**Cardiovascular Status:**  
- Heart rate: 120-140 beats per minute;  
- Mean arterial pressure (MAP): 10-11;  
- Blood pressure: Stable;  

**Laboratory Results:**  
- Bilirubin levels: 2.1, with ongoing phototherapy;  
- Hematocrit: 36.1;  
- Blood cultures: Pending;  

**Nursing Assessments:**  
- Patient appears well-perfused and pink; no murmurs detected;  
- Feeding: Total parenteral nutrition (TPN) at 150 cc/kg/day; NPO;  
- Normal urinary output; no stools noted;  

**Plan:**  
- Monitor respiratory status closely; adjust ventilator settings as needed;  
- Continue IV antibiotics (vancomycin and gentamicin);  
- Regularly assess bilirubin and glucose levels;  
- Reassess vital signs and clinical status every shift;  
- Continue supportive care for growth and development;  

**Follow-up:**  
- Schedule next blood gas at 2300;  
- Observe for signs of sepsis or respiratory distress;  
- Update family on patient status and care plan.
